const Application = styled.div`
  position: fixed;
  border: 1px solid black;
  display: flex;
  flex-direction: column;
  height: 95%;
  width: 100%;
`;
const AppHeader = styled.header`
  width: 100%;
  height: 100%;
  border: 1px solid green;
  display: flex;
  align-items: center;
  justify-content: center;
`;
const Container = styled.section`
  height: 100%;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
`;
const AppFooter = styled.footer`
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;`;

const App = () => {
  return (
    <Application>
      <AppHeader>Harrison Lau</AppHeader>
      <Container>

      </Container>
      <AppFooter></AppFooter>
    </Application>

  )
}

export default App;
